import React from 'react';
import '../../css/Sidebar.css';
import { FaHome, FaThLarge, FaBoxOpen, FaClipboardList, FaUser, FaTicketAlt, FaCommentDots, FaListAlt, FaPenFancy } from 'react-icons/fa';

const Sidebar = () => {
  return (
    <div className="sidebar">
      <div className="logo">
        <img src="/logo192.png" alt="PetWorld Logo" />
        <h2>Adminator</h2>
      </div>
      <ul className="nav-list">
        <li><FaHome /><span>Thống kê</span></li>
        <li><FaThLarge /><span>Quản lý danh mục</span></li>
        <li><FaBoxOpen /><span>Quản lý sản phẩm</span></li>
        <li><FaClipboardList /><span>Quản lý đơn hàng</span></li>
        <li><FaUser /><span>Quản lý tài khoản</span></li>
        <li><FaTicketAlt /><span>Quản lý voucher</span></li>
        <li><FaCommentDots /><span>Quản lý bình luận</span></li>
        <li><FaListAlt /><span>Quản lý danh mục bài viết</span></li>
        <li><FaPenFancy /><span>Quản lý bài viết</span></li>
      </ul>
    </div>
  );
};

export default Sidebar;
